import logo from './logo.svg';
import './App.css';
import {BrowserRouter,Routes,Route}  from "react-router-dom"
import Course from './Layout/Course';
function App() {
  return (
        <BrowserRouter>
          <Routes>
          <Route path="/" element={<Course/>} />
            <Route path="course" element={<Course/>} />
          </Routes>
        </BrowserRouter>
  );
}

export default App;
